import React, { useState, useRef, useEffect } from 'react';

const Canvas = () => {
  const canvasRef = useRef(null);
  const color = 'black';

  useEffect(() => {
    if (canvasRef.current) {
      console.log(canvasRef.current);
    }
  });

  return (
    <div>
      <canvas
        ref={canvasRef}
      >
      </canvas>
    </div>
  );
};

export default Canvas;
